DROP TABLE IF EXISTS `clients`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `clients` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL COMMENT 'Наименование организации / имя заемщика-физ.лица',
  `surname` varchar(255) DEFAULT NULL COMMENT 'Фамилия заемщика-физ.лица',
  `birthday` date DEFAULT NULL COMMENT 'Дата создания / рождения',
  `inn` varchar(255) DEFAULT NULL COMMENT ' ИНН',
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `is_worker` tinyint(1) DEFAULT NULL COMMENT 'Является ли клиент работником банка',
  `is_organization` tinyint(1) DEFAULT NULL COMMENT 'Является ли клиент организацией',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=140 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
