DROP TABLE IF EXISTS `contracts`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `contracts` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL COMMENT 'Наименование договора',
  `date` date DEFAULT NULL COMMENT 'Дата договора',
  `date_end` date DEFAULT NULL COMMENT 'Срок действия договора',
  `client_id` bigint unsigned DEFAULT NULL COMMENT 'Клиент',
  `worker_id` smallint unsigned DEFAULT NULL COMMENT 'Подписант со стороны банка',
  `created_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`),
  KEY `contracts_clients_client_id_fk` (`client_id`),
  KEY `contracts_workers_worker_id_fk` (`worker_id`),
  CONSTRAINT `contracts_clients_client_id_fk` FOREIGN KEY (`client_id`) REFERENCES `clients` (`id`),
  CONSTRAINT `contracts_workers_worker_id_fk` FOREIGN KEY (`worker_id`) REFERENCES `workers` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=213776 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

